import React from 'react';

import Header from './components/Header/Header';
import VerticalMenu from './components/VerticalMenu/VerticalMenu';

import './Dashboard.css';

const Dashboard = () => {
	return (
		<div className="dashboard">
			<Header />
			<VerticalMenu />;
		</div>
	);
};

export default Dashboard;
